-- Removing temporary table and create final VIEW structure
DROP TABLE IF EXISTS `v_item_stok`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `v_item_stok` AS SELECT 
    i.id AS id_item,
    g.id AS id_gudang,
    g.nama AS gudang,
    i.kode,
    i.item AS item,
    
    COALESCE(SUM(CASE 
        WHEN h.status IN ('1','2','3') THEN h.jml 
        ELSE 0 
    END), 0) AS stok_masuk,

    COALESCE(SUM(CASE 
        WHEN h.status IN ('4','5') THEN h.jml 
        ELSE 0 
    END), 0) AS stok_keluar,

    -- Ambil stok SO terakhir (nilai jml) dari record SO terbaru
    COALESCE((
        SELECT h2.jml
        FROM tbl_m_item_hist h2
        WHERE h2.id_item = i.id
          AND h2.id_gudang = g.id
          AND h2.status = '6'
        ORDER BY h2.created_at DESC
        LIMIT 1
    ), 0) AS stok_so,

    COALESCE(SUM(CASE 
        WHEN h.status IN ('1','2','3') THEN h.jml 
        WHEN h.status IN ('4','5') THEN -h.jml 
        ELSE 0 
    END), 0) AS stok_akhir

FROM 
    tbl_m_item i
CROSS JOIN 
    tbl_m_gudang g
LEFT JOIN 
    tbl_m_item_hist h 
    ON h.id_item = i.id AND h.id_gudang = g.id AND h.status IN ('1','2','3','4','5')
GROUP BY 
    i.id, g.id
ORDER BY
    i.id, g.id ;

